import React from 'react';
import './App.css';
import {fetchImageUrls} from './imageUtils'


function App() {
  const [imageSources, setImageSources] = React.useState([]);

  React.useEffect(() => {
    loadImageSources(setImageSources)
  }, [])

  const refreshImages = React.useCallback(() => loadImageSources(setImageSources), [setImageSources])


  return (
    <div className='container'>
      <div className='row mt-4'><h2>Randomized Images</h2></div>
      <div className='row mt-4'><button className='btn-primary' onClick={refreshImages}>Refresh</button></div>
      <div className='row mt-5'>{imageSources.map(imageSource => <div className='col col-md-3 mt-4'><img crossOrigin='anonymous' src={imageSource}></img></div>)}</div>
    </div>
  );
}

function loadImageSources(setImageSources) {
  fetchImageUrls().then(imageUrls => setImageSources(imageUrls))
}

export default App;
